import React, { useState } from 'react'
import {
    AccordionItem,
    AccordionButton,
    AccordionPanel,
    AccordionIcon,
    Box,
  } from '@chakra-ui/react'

import FamilyTreeComponent from '../FamilyTreeComponent'

function index(props) {

  return (
    <AccordionItem>
        <h2>
            <AccordionButton>
            <Box as="span" flex='1' textAlign='left'>
                {props.element.name}
            </Box>
            <AccordionIcon />
            </AccordionButton>
        </h2>
        <AccordionPanel pb={props.i}>
        <Box
            overflowY="auto"
            css={{
                '&::-webkit-scrollbar': {
                width: '4px',
                },
                '&::-webkit-scrollbar-track': {
                width: '6px',
                },
                '&::-webkit-scrollbar-thumb': {
                scrollbarColor: 'red green',
                borderRadius: '24px',
                },
            }}
            ><FamilyTreeComponent data={propsfamilyTree}/></Box>
        </AccordionPanel>
    </AccordionItem>
  )
}

export default index
